insert  into `user_temp_b`(`USER_TEMP_ID`,`KEY_CLASS`,`KEY_NAME`,`KEY_CONTENT`,`STATE`,`ORDER_NO`,`CNOTE`,`UPDATE_BY`,`UPDATE_TIME`) values ('4028817a33fc4e280133fc5218a20001','contractRequest','contractRequest','★   产品与封样无明显差异，唛头、标签及包装质量务必符合公司要求。 \r\n ★★  产品生产前期、中期、后期抽验率不得少于10%，质量和封样一致， \r\n       并将验货照片传回公司。 \r\n★★★ 重点客人的质量标准检验，产品抽验率不得少于50%，务必做到入箱前检查。 \r\n 交期：deliveryPeriod/工厂。 \r\n       没有经过我司同意无故延期交货造成严重后果的，按照客人的相关要求处理。 \r\n 开票：出货后请将增值税发票、验货报告、合同复印件及出库单一并寄至我司，以便我司安排付款。',1,1,'合同要求(第一行系统自动会加空格)','001','2012-01-18 11:42:05'),('4028817a33fc4e280133fc543c8c0002','productRequest','electroplate','★   产品与封样无明显差异，唛头、标签及包装质量务必符合公司要求。 \r\n ★★  产品生产前期、中期、后期抽验率不得少于10%，质量和封样一致， \r\n       并将验货照片传回公司。 \r\n★★★ 重点客人的质量标准检验，产品抽验率不得少于50%，务必做到入箱前检查。 \r\n 交期：deliveryPeriod/工厂。毛坯送至祁县瑞成玻璃镀膜厂。 \r\n       没有经过我司同意无故延期交货造成严重后果的，按照客人的相关要求处理。 \r\n 开票：出货后请将增值税发票、验货报告、合同复印件及出库单一并寄至我司，以便我司安排付款。',1,5,'电镀','001','2011-12-02 09:19:45'),('4028817a33fc4e280133fc543c8c0003','productRequest','decal','1.产品的颜色、造型、尺寸、重量务必同我司封样一致；\r\n2.工厂免费提供2% 余量，以防损耗，代用包装送至指定工厂；请在外包装上注明相对应的合同号及货号；\r\n3.交期:。',1,3,'花纸','001','2011-12-02 09:12:18'),('4028817a33fc4e280133fc543c8c0004','productRequest','colorBox','1.彩盒要求350克面纸；\r\n2.工厂待用安全包装，待我司运至工厂；\r\n3.工厂免费提供1%余量，以防划伤，破损；\r\n4.交期:。',1,2,'彩盒','001','2011-12-02 09:12:18'),('4028817a33fc4e280133fc543c8c0005','productRequest','styrofoam','1.产品质量要好，颗粒细小，压制密实，无毛边；\r\n2.工厂待用安全包装，运至指定工厂；\r\n3.交期：。',1,4,'保丽龙','001','2011-12-02 09:12:18'),('4028817a341195e9013411bc0d690001','productRequest','nozzle','1.包装：暗转包装送指定工厂。\r\n2.交期：。\r\n3.付款方式：货到付款。',1,7,'','001','2011-12-06 12:57:43'),('4028817a341195e9013411bc0d690002','productRequest','pvc','',1,6,'','001','2011-12-06 12:57:43');

